    "res_auth": "{\r\n  \"rt_cd\": \"0\",\r\n  \"msg_cd\": \"APBK0013\",\r\n  \"msg1\": \"주문 전송 완료 되었습니다.\",\r\n  \"output\": {\r\n    \"KRX_FWDG_ORD_ORGNO\": \"06010\",\r\n    \"ODNO\": \"0001569157\",\r\n    \"ORD_TMD\": \"155211\"\r\n  }\r\n}",
    "res_no_auth": "{\r\n\"CANO\": \"종합계좌번호를 입력하세요.\",\r\n\"PDNO\": \"상품번호를 입력하세요.\",\r\n\"ORD_TYPE\" : \"주문유형을 입력하세요.\",\r\n\"CTAC_TLNO\": \"연락전화번호를 입력하세요.\",\r\n\"ACNT_PRDT_CD\": \"계좌상품코드를 입력하세요.\",\r\n\"ORD_DVSN\": \"주문구분을 입력하세요. \",\r\n\"ORD_QTY\": \"주문수량을 입력하세요.\",\r\n\"ORD_UNPR\": \"주문단가를 입력하세요.\"\r\n}\r\n",
