    "req_example": "{\r\n\"CANO\": \"810XXXXX\",\r\n\"ACNT_PRDT_CD\": \"01\",\r\n\"OVRS_EXCG_CD\": \"NASD\",\r\n\"PDNO\": \"AAPL\",\r\n\"ORD_QTY\": \"1\",\r\n\"OVRS_ORD_UNPR\": \"145.00\",\r\n\"CTAC_TLNO\": \"\",\r\n\"MGCO_APTM_ODNO\": \"\",\r\n\"ORD_SVR_DVSN_CD\": \"0\",\r\n\"ORD_DVSN\": \"00\"\r\n}",
