    "res_no_auth": "{\r\n\"CANO\": \"종합계좌번호를 입력하세요.\",\r\n\"ACNT_PRDT_CD\":\"계좌상품코드를 입력하세요.\",    \r\n\"OVRS_EXCG_CD\": \"해외거래소코드를 입력하세요.\",\r\n\"PDNO\": \"상품번호를 입력하세요.\",\r\n\"ORD_QTY\": \"주문수량을 입력하세요.\",\r\n\"OVRS_ORD_UNPR\": \"해외주문단가를 입력하세요.\",\r\n\"CTAC_TLNO\": \"연락전화번호를 입력하세요.\",\r\n\"MGCO_APTM_ODNO\": \"운용사지정주문번호를 입력하세요.\",\r\n\"ORD_SVR_DVSN_CD\": \"주문서버구분코드를 입력하세요.\",\r\n\"ORD_DVSN\": \"주문구분을 입력하세요.\"\r\n}\r\n",
