    "api_summary": "접수된 해외주식 주문을 정정하거나 취소하기 위한 API입니다.\r\n(해외주식주문 시 Return 받은 ODNO를 참고하여 API를 호출하세요.)\r\n\r\n* 해외주식 서비스 신청 후 이용 가능합니다. (아래 URL 참고)\r\nhttps://securities.koreainvestment.com/main/bond/research/_static/TF03ca010000.jsp\r\n\r\n* 해외 거래소 운영시간 외 API 호출 시 애러가 발생하오니 운영시간을 확인해주세요.\r\n* 해외 거래소 운영시간(한국시간 기준)\r\n1) 미국 : 23:30 ~ 06:00 (썸머타임 적용 시 22:30 ~ 05:00)\r\n2) 일본 : (오전) 09:00 ~ 11:30, (오후) 12:30 ~ 15:00\r\n3) 상해 : 10:30 ~ 16:00\r\n4) 홍콩 : (오전) 10:30 ~ 13:00, (오후) 14:00 ~ 17:00\r\n\r\n※ POST API의 경우 BODY값의 key값들을 대문자로 작성하셔야 합니다.\r\n   (EX. \"CANO\" : \"12345678\", \"ACNT_PRDT_CD\": \"01\",...)\r\n",
    "oauth": "Y",
    "http_method": "POST",
    "req_format": "JSON",
    "content_type": "application/json; charset=UTF-8",
    "req_example": "{\r\n\"CANO\": \"810XXXXX\",\r\n\"ACNT_PRDT_CD\": \"01\",\r\n\"OVRS_EXCG_CD\": \"NYSE\",\r\n\"PDNO\": \"BA\",\r\n\"ORGN_ODNO\": \"30135009\",\r\n\"RVSE_CNCL_DVSN_CD\": \"01\",\r\n\"ORD_QTY\": \"1\",\r\n\"OVRS_ORD_UNPR\": \"226.00\",\r\n\"CTAC_TLNO\": \"\",\r\n\"MGCO_APTM_ODNO\": \"\",\r\n\"ORD_SVR_DVSN_CD\": \"0\"\r\n}",
